import React from "react";

const Wedding = () => {
  return (
    <section className="justify-center py-1 md:py-8 text-yellow-600 grid gap-2">
      <div className="text-center font-bold sm:text-1.5xl md:text-1.875xl xl:text-2.25xl text-3xl">UNTIL THE WEDDING OF</div>
      <div className="font-Sacramento sm:text-5xl md:text-6xl xl:text-7xl text-3xl">Putri & Arif</div>
    </section>
  );
};

export default Wedding;
